import React, {Component} from 'react'
import ModalWrapper from './Modals/ModalWrapper';
import "./MAR.css"

export default class MAR extends Component {
constructor(props) {
    super(props);
    this.state = {searchText:null}
}

    addressSearch = (evt) => {
        if (evt.which === 13) {
            console.log('evt :', evt);
        }

    }

    textChange = (evt) =>{
        evt.persist();
        console.log('evt', evt)

    }
    cancelClickHandler = (evt) => {
        this
            .props
            .modalClicked(false, null)
    }

    render() {
        return (
            <ModalWrapper{...this.props}
                title="MAR Query"
                width
                ={400}
                showOk={this.props.map.showOk}>

                <div className="MAR">
                    <div
                        className="MARCancel"
                        title="Close Window"
                        onClick={this.cancelClickHandler}>X</div>
                    <p>
                        TYPE AN ADDRESS AND PRESS ENTER</p>
                    <input onKeyPress={this.addressSearch} onChange = {this.textChange}></input>

                </div>
            </ModalWrapper>
        )
    }
}
